(7990, 2533, 'testimonial_cite_text', 'We were referred to Themesholic from colleagues of ours in London. Not only have we been constantly amazed at the depth of understanding on many different business models, we found ourselves working with a team of friends.'),
(7991, 2533, 'testimonial_cite_name', 'James Wooden'),
(7992, 2533, 'testimonial_company', 'Integrate Inc.'),
