(7998, 2534, 'slide_template', 'default'),
(7999, 2534, 'testimonial_cite_text', 'They are a first-rate and high level design agency that we will be working with closely in the years to come. We worked with Justin and Aaron on re-organizing our Hotel Chain from Dubai. Working remotely was smooth and reliable. '),
(8000, 2534, 'testimonial_cite_name', 'Robert Lambert'),
(8001, 2534, 'testimonial_company', 'Flyware'),
