(8006, 2535, '_wpb_vc_js_interface_version', '2'),
(8007, 2535, 'slide_template', 'default'),
(8008, 2535, 'testimonial_cite_text', 'We hired Themesholic to organise our business online, simplify our process, create an amazing brand that communicated to our demographic clearly, and increase our sales. We highly recommend the entire team! '),
(8009, 2535, 'testimonial_cite_name', 'Loise Mac Callister'),
(8010, 2535, 'testimonial_company', 'ProudBe'),
(8011, 2535, 'testimonial_company_url', '#'),
