(8016, 2536, 'slide_template', 'default'),
(8017, 2536, 'testimonial_cite_text', 'Anytime I had issues or questions about my web design, I never thought twice about contacting Themesholic and expressing my concern or question. The process that Web Success Agency went through to ensure the quality of my design was easy, organized and focused on my ideas.'),
(8018, 2536, 'testimonial_cite_name', 'Peter Granth'),
